import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";
import BusinessCenterIcon from "@mui/icons-material/BusinessCenter";

const Cart2 = ({ data }) => {
  console.log(data);
  return (
    <Box className="Cart_2">
      <Box className="element">
        <BusinessCenterIcon>
        {data}
        </BusinessCenterIcon>
      </Box>
    </Box>
  );
};

export default Cart2;
